Creates a VPC endpoint for a specified service. An endpoint enables you to create a private
connection between your VPC and the service. The service may be provided by AWS, an AWS
Marketplace Partner, or another AWS account. For more information, see VPC Endpoints in the
Amazon Virtual Private Cloud User Guide. A gateway endpoint serves as a target for a route
in your route table for traffic destined for the AWS service. You can specify an endpoint
policy to attach to the endpoint, which will control access to the service from your VPC.
You can also specify the VPC route tables that use the endpoint. An interface endpoint is a
network interface in your subnet that serves as an endpoint for communicating with the
specified service. You can specify the subnets in which to create an endpoint, and the
security groups to associate with the endpoint network interface. A GatewayLoadBalancer
endpoint is a network interface in your subnet that serves an endpoint for communicating
with a Gateway Load Balancer that you've configured as a VPC endpoint service. Use
DescribeVpcEndpointServices to get a list of supported services.

# Arguments
- `service_name`: The service name. To get a list of available services, use the
  DescribeVpcEndpointServices request, or get the name from the service provider.
- `vpc_id`: The ID of the VPC in which the endpoint will be used.

# Optional Parameters
Optional parameters can be passed as a `params::Dict{String,<:Any}`. Valid keys are:
- `"ClientToken"`: Unique, case-sensitive identifier that you provide to ensure the
  idempotency of the request. For more information, see How to Ensure Idempotency.
- `"DryRun"`: Checks whether you have the required permissions for the action, without
  actually making the request, and provides an error response. If you have the required
  permissions, the error response is DryRunOperation. Otherwise, it is UnauthorizedOperation.
- `"PolicyDocument"`: (Interface and gateway endpoints) A policy to attach to the endpoint
  that controls access to the service. The policy must be in valid JSON format. If this
  parameter is not specified, we attach a default policy that allows full access to the
  service.
- `"PrivateDnsEnabled"`: (Interface endpoint) Indicates whether to associate a private
  hosted zone with the specified VPC. The private hosted zone contains a record set for the
  default public DNS name for the service for the Region (for example,
  kinesis.us-east-1.amazonaws.com), which resolves to the private IP addresses of the
  endpoint network interfaces in the VPC. This enables you to make requests to the default
  public DNS name for the service instead of the public DNS names that are automatically
  generated by the VPC endpoint service. To use a private hosted zone, you must set the
  following VPC attributes to true: enableDnsHostnames and enableDnsSupport. Use
  ModifyVpcAttribute to set the VPC attributes. Default: true
- `"RouteTableId"`: (Gateway endpoint) One or more route table IDs.
- `"SecurityGroupId"`: (Interface endpoint) The ID of one or more security groups to
  associate with the endpoint network interface.
- `"SubnetId"`: (Interface and Gateway Load Balancer endpoints) The ID of one or more
  subnets in which to create an endpoint network interface. For a Gateway Load Balancer
  endpoint, you can specify one subnet only.
- `"TagSpecification"`: The tags to associate with the endpoint.
- `"VpcEndpointType"`: The type of endpoint. Default: Gateway
